import "./Header.css";
import AwesomeSlider from 'react-awesome-slider';
import images1 from "../../images/images.jpg";

const Header = () => {



  return (
    <span onClick={() => window.scroll(0, 0)} className="header">
      <AwesomeSlider>
    <div data-src={images1} />
    <div  data-src={images1} />
    <div  data-src={images1} />
  </AwesomeSlider>


    </span>

  );
};

export default Header;
